import React,{Component} from 'react'
import { View, Text, StyleSheet,  SafeAreaView,Image, AsyncStorage, ToastAndroid, Dimensions,Clipboard ,Linking,TextInput, FlatList} from 'react-native';
import {url1} from '../../API/types';
import axios from 'axios';
import { Toast } from 'native-base';
 
export default class DepartmentFeed extends Component {
  constructor(){
    super();
    this.state = {
      token:'',
      token_type: '',
      dataSource: dataData,
      search: '',
      masterDataSource:dataData,
      filteredDataSource:dataData,

      // masterDataSource:[],
      // filteredDataSource:[]
    }
  }

   searchFilterFunction = (text) => {
    // Check if searched text is not blank
    if (text) {
      const newData = this.state.masterDataSource.filter(
        function (item) {
          const itemData = item.name
            ? item.name.toUpperCase()
            : ''.toUpperCase();
          const textData = text.toUpperCase();
          return itemData.indexOf(textData) > -1;
      });
      this.setState({filteredDataSource: newData});
      this.setState({search: text});
    } else {
      this.setState({filteredDataSource: this.state.masterDataSource});
      this.setState({search: text});
    }
  };

  UNSAFE_componentWillMount(){
    this.getToken();

    
  }
  getToken = async() =>{
    this.setState({token:await AsyncStorage.getItem('token')});
    this.setState({token_type:await AsyncStorage.getItem('token_type')});
    this.loadPosts();
  }

  loadPosts(){
  if(this.state.token!='' && this.state.token_type!=''){
    axios({
      method: 'get',
      url: url1 +'Department',
      headers: {
        'Authorization':this.state.token_type+' '+this.state.token,
        'Content-Type': 'application/json',
        'Accept': 'application/json',
      },
    })
      .then(res => {
       let temp=JSON.stringify(res.data);
        if(temp.includes('text')){
          this.setState({
            dataSource:res.data
          })
          this.setState({masterDataSource: res.dada})
          this.setState({filteredDataSource: res.dada})
        }
        else{
          console.log(res.data);
        }
      })
      .catch(err => {
        console.log(err);
      })
    }
    else{
      ToastAndroid.show("Empty Token",ToastAndroid.SHORT);
    }
  }


  Test = ({item}) => {
    return (
        <SafeAreaView style={{flex:1}} >
        <View style={{flex:1, backgroundColor:"#f5f4f9" }}>
        <View style={styles.postContainer}>
        <View style={{flexDirection:"row"}}>
        <Text style={{left:65,top:25}} >{item.name}</Text>
        {/* <Text style={{left:110,top:25,color:"grey"}} >10min ago </Text> */}
        </View>
        <Image source={{ uri: 'data:image/png;base64,'+ item.photo }} style={{ width: 45, height: 45, borderRadius: 30 }} />
        <View style={styles.innerContainer}>
    <Text  onPress={() =>  Linking.openURL(item.text)} onLongPress={() => {Clipboard.setString(item.text),
       ToastAndroid.show("Coppied",ToastAndroid.SHORT);  }} style={{textAlign:"justify", paddingLeft: 10, paddingRight: 10}} >{item.text}</Text>
        </View>
    </View>
    </View>
    </SafeAreaView>
    );
  }

  
 
  render(){
    return (
    <>
      <TextInput
      style={styles.textInputStyle}
      onChangeText={(text) => this.searchFilterFunction(text) }
       value={this.state.search}
      underlineColorAndroid="transparent"
      placeholder="Search Here"
    />
        <FlatList
        data={this.state.filteredDataSource}
        style={{marginTop: 1, marginStart: 1}}
        renderItem={this.Test}
        numColumns={1}
        indicatorStyle={"black"}
        showsVerticalScrollIndicator={true}
        
      />

      </>
    )

  }
}
